import React, { useState } from 'react';
import { useEffect } from 'react';


export default function PageAccueil() {
  const [seconds, setSeconds] = useState(1);

  useEffect(() => {
    const timer = setInterval(() => {
      setSeconds(seconds + 1);
    }, 1000);
    return () => clearInterval(timer);
  });
  
  return (
    <div>
        <p>
          {first}
        </p>
    </div>
  )
}
